ForestInMap::ForestInMap()
{
	Init();
	DrawOwnScn();
}

ForestInMap::~ForestInMap()
{
}

void ForestInMap::Update(Vector2 offset)
{
	mOffset = { offset.x_,offset.y_ };
}

void ForestInMap::DrawOwnScn()
{
	for (int x = 0; x < MAP_X; x++)
	{
		for (int y = 0; y < MAP_Y; y++)
		{
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[fi_soil[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[fi_tree[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[fi_obj1[y][x]], true);

			DrawFormatString(32 * x - mOffset.x_, 32 * y - mOffset.y_, GetColor(255, 0, 0), "%d", fi_soil[y][x]);
			DrawFormatString(0, 10, GetColor(255, 255, 255), "mapPos=(%d,%d)", mOffset.x_, mOffset.y_);
		}
	}
}

bool ForestInMap::Init(void)
{
	if (LoadDivGraph("./image/map.png", 2800, 56, 50, 32, 32, &mChipImage[0]) == -1)
	{
		return false;
	}
	return true;
}

bool ForestInMap::CheckMapChip(Vector2 pos)
{
	soil = fi_soil[pos.y_ / 32][pos.x_ / 32];
	tree = fi_tree[pos.y_ / 32][pos.x_ / 32];
	obj1 = fi_obj1[pos.y_ / 32][pos.x_ / 32];

	bool flg = false;	//true=player

		//s
	switch (soil)
	{
	case -1:
	case 896:
	case 454:
	case 337:
		flg = true;
		break;
	default:
		break;
	}

	return flg;
}

int ForestInMap::GetMapChip(Vector2 pos)
{
	return 0;
}

